export const body = `\n<p><b>Armed conflicts and attacks</b>\n</p>\n<ul><li><a href=\"/wiki/Israeli%E2%80%93Palestinian_conflict\" title=\"Israeli\u2013Palestinian conflict\">Israeli\u2013Palestinian conflict</a>\n<ul><li><a href=\"/wiki/Palestinian_political_violence\" title=\"Palestinian political violence\">Palestinian political violence</a>\n<ul><li>A <a href=\"/wiki/Palestinian\" class=\"mw-redirect\" title=\"Palestinian\">Palestinian</a> man <a href=\"/wiki/Vehicle_ramming_attack\" class=\"mw-redirect\" title=\"Vehicle ramming attack\">rams</a> into <a href=\"/wiki/Israel\" title=\"Israel\">Israeli</a> pedestrians near <a href=\"/wiki/Al-Khader\" title=\"Al-Khader\">Al-Khader</a> in the <a href=\"/wiki/West_Bank\" title=\"West Bank\">West Bank</a>, injuring two children, before being shot. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.timesofisrael.com/two-teens-injured-in-car-ramming-terror-attack-on-west-bank-highway-near-jerusalem/\">(<i>The Times of Israel</i>)</a> <a rel=\"nofollow\" class=\"external text\" href=\"https://www.haaretz.com/israel-news/2025-09-30/ty-article/.premium/two-teenagers-wounded-in-ramming-attack-at-west-bank-junction-near-jerusalem/00000199-9a9a-d0f3-a599-defb3aff0000\">(Haaretz)</a></li></ul></li></ul></li></ul>\n<ul><li><a href=\"/wiki/Russo-Ukrainian_war_(2022%E2%80%93present)\" title=\"Russo-Ukrainian war (2022\u2013present)\">Russo-Ukrainian war</a>\n<ul><li><a href=\"/wiki/Attacks_on_civilians_in_the_Russo-Ukrainian_war_(2022%E2%80%93present)\" title=\"Attacks on civilians in the Russo-Ukrainian war (2022\u2013present)\">Attacks on civilians in the Russo-Ukrainian war</a>\n<ul><li>An overnight <a href=\"/wiki/Russian_Armed_Forces\" title=\"Russian Armed Forces\">Russian</a> <a href=\"/wiki/Drone_warfare\" title=\"Drone warfare\">drone strike</a> kills four people, all members of the same family, in <a href=\"/wiki/Chernechchyna,_Okhtyrka_Raion,_Sumy_Oblast\" title=\"Chernechchyna, Okhtyrka Raion, Sumy Oblast\">Chernechchyna, Okhtyrka Raion, Sumy Oblast</a>, <a href=\"/wiki/Ukraine\" title=\"Ukraine\">Ukraine</a>. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.bbc.co.uk/news/articles/cdxqdpgznzeo\">(BBC News)</a></li></ul></li></ul></li>\n<li><a href=\"/wiki/Insurgency_in_Balochistan\" title=\"Insurgency in Balochistan\">Insurgency in Balochistan</a>\n<ul><li>Ten people are killed and over 30 others are injured in a <a href=\"/wiki/Suicide_attack\" title=\"Suicide attack\">suicide</a> <a href=\"/wiki/Car_bomb\" title=\"Car bomb\">car bombing</a> followed by gunfire outside the <a href=\"/wiki/Frontier_Corps\" title=\"Frontier Corps\">Frontier Corps</a>' headquarters in <a href=\"/wiki/Quetta\" title=\"Quetta\">Quetta</a>, <a href=\"/wiki/Balochistan,_Pakistan\" title=\"Balochistan, Pakistan\">Balochistan Province</a>, <a href=\"/wiki/Pakistan\" title=\"Pakistan\">Pakistan</a>. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.aljazeera.com/news/2025/9/30/suicide-blast-near-paramilitary-headquarters-in-pakistans-quetta-kills-10\">(Al Jazeera)</a></li></ul></li></ul>\n<p><b>Disasters and accidents</b>\n</p>\n<ul><li><a href=\"/wiki/2025_Cebu_earthquake\" title=\"2025 Cebu earthquake\">2025 Cebu earthquake</a>\n<ul><li>A M<sub>w</sub>&#8239;6.9 <a href=\"/wiki/Earthquake\" title=\"Earthquake\">earthquake</a> hits the central <a href=\"/wiki/Philippines\" title=\"Philippines\">Philippines</a> with damages and <a href=\"/wiki/Power_interruption\" class=\"mw-redirect\" title=\"Power interruption\">power interruption</a> reported, particularly in <a href=\"/wiki/Cebu\" title=\"Cebu\">Cebu</a>. At least five people are reported dead as <a href=\"/wiki/Search_and_rescue\" title=\"Search and rescue\">search and rescue</a> operations are ongoing. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.theguardian.com/world/2025/sep/30/central-philippines-hit-by-powerful-earthquake\">(AFP via <i>The Guardian</i>)</a> <a rel=\"nofollow\" class=\"external text\" href=\"https://www.newsweek.com/earthquake-philippines-cebu-today-usgs-magnitude-warning-10805872\">(<i>Newsweek</i>)</a> <a rel=\"nofollow\" class=\"external text\" href=\"https://www.aa.com.tr/en/asia-pacific/5-dead-after-magnitude-69-earthquake-jolts-philippines/3703494\">(Anadolu Agency)</a></li></ul></li>\n<li>Nine people are killed after an under-construction coal handling enclosure collapsed in <a href=\"/wiki/Chennai\" title=\"Chennai\">Chennai</a>, <a href=\"/wiki/India\" title=\"India\">India</a>. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.ndtv.com/india-news/9-killed-in-arch-collapse-at-tamil-nadu-power-plant-pm-announces-compensation-9373869\">(NDTV)</a></li>\n<li>Five people are killed after a truck collides with two motorbikes in <a href=\"/wiki/Bhind_district\" title=\"Bhind district\">Bhind district</a>, <a href=\"/wiki/Madhya_Pradesh\" title=\"Madhya Pradesh\">Madhya Pradesh</a>, <a href=\"/wiki/India\" title=\"India\">India</a>. <a rel=\"nofollow\" class=\"external text\" href=\"https://indianexpress.com/article/india/five-killed-truck-collides-motorcycles-madhya-pradesh-bhind-10279947/?ref=archive_pg(The\">Indian express)</a></li></ul>\n<p><b>International relations</b>\n</p>\n<ul><li><a href=\"/wiki/France%E2%80%93South_Africa_relations\" title=\"France\u2013South Africa relations\">France\u2013South Africa relations</a>\n<ul><li><a href=\"/wiki/List_of_diplomatic_missions_of_South_Africa\" title=\"List of diplomatic missions of South Africa\">South African ambassador</a> to <a href=\"/wiki/France\" title=\"France\">France</a> and former <a href=\"/wiki/Minister_of_Sport,_Arts_and_Culture\" title=\"Minister of Sport, Arts and Culture\">Minister of Sport, Arts and Culture</a> <a href=\"/wiki/Nathi_Mthethwa\" title=\"Nathi Mthethwa\">Nathi Mthethwa</a> is found dead outside his hotel in <a href=\"/wiki/17th_arrondissement_of_Paris\" title=\"17th arrondissement of Paris\">17th arrondissement</a>, <a href=\"/wiki/Paris\" title=\"Paris\">Paris</a>. The ambassador had previously been reported missing by his wife. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.reuters.com/world/europe/south-africas-ambassador-france-found-dead-paris-le-parisien-2025-09-30/\">(Reuters)</a></li></ul></li></ul>\n<p><b>Law and crime</b>\n</p>\n<ul><li><a href=\"/wiki/Capital_punishment_in_the_Democratic_Republic_of_the_Congo\" title=\"Capital punishment in the Democratic Republic of the Congo\">Capital punishment in the Democratic Republic of the Congo</a>\n<ul><li>A <a href=\"/wiki/Military_court\" class=\"mw-redirect\" title=\"Military court\">military court</a> in the <a href=\"/wiki/Democratic_Republic_of_the_Congo\" title=\"Democratic Republic of the Congo\">Democratic Republic of the Congo</a> sentences former president <a href=\"/wiki/Joseph_Kabila\" title=\"Joseph Kabila\">Joseph Kabila</a> to death <i><a href=\"/wiki/In_absentia\" class=\"mw-disambig\" title=\"In absentia\">in absentia </a></i> for treason. <a rel=\"nofollow\" class=\"external text\" href=\"https://apnews.com/article/joseph-kabila-treason-convicted-death-sentence-m23-rwanda-b2a21a4203fd78e68cf4fc506d56544b\">(AP)</a></li></ul></li>\n<li><a href=\"/wiki/Chinese_intelligence_activity_abroad\" title=\"Chinese intelligence activity abroad\">Chinese intelligence activity abroad</a>, <a href=\"/wiki/China%E2%80%93Germany_relations\" title=\"China\u2013Germany relations\">China\u2013Germany relations</a>\n<ul><li>The <a href=\"/wiki/Higher_Regional_Court_of_Dresden\" title=\"Higher Regional Court of Dresden\">Higher Regional Court of Dresden</a> convicts a <a href=\"/wiki/Chinese_people_in_Germany\" title=\"Chinese people in Germany\">Chinese</a>\u2013<a href=\"/wiki/Germany\" title=\"Germany\">German</a> man of <a href=\"/wiki/Espionage\" title=\"Espionage\">espionage</a> for <a href=\"/wiki/China\" title=\"China\">China</a> while working for <a href=\"/wiki/Alternative_for_Germany\" title=\"Alternative for Germany\">AfD</a> politician <a href=\"/wiki/Maximilian_Krah\" title=\"Maximilian Krah\">Maximilian Krah</a>, giving him a sentence of over five years. A <a href=\"/wiki/Defendant\" title=\"Defendant\">co-defendant</a> accused of supplying cargo and passenger information from her job at <a href=\"/wiki/Leipzig/Halle_Airport\" title=\"Leipzig/Halle Airport\">Leipzig Airport</a> is given a <a href=\"/wiki/Suspended_sentence\" title=\"Suspended sentence\">suspended sentence</a> of one and a half years. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.msn.com/en-us/news/world/former-aide-to-german-far-right-lawmaker-in-the-european-parliament-is-convicted-of-spying-for-china/ar-AA1NzB1x?ocid=BingNewsSerp\">(AP)</a></li></ul></li></ul>\n<p><b>Science and technology</b>\n</p>\n<ul><li><a href=\"/wiki/Human_rights_in_Afghanistan\" title=\"Human rights in Afghanistan\">Human rights in Afghanistan</a>\n<ul><li><a href=\"/wiki/Telecommunications\" title=\"Telecommunications\">Telecommunications</a> are almost entirely down in <a href=\"/wiki/Afghanistan\" title=\"Afghanistan\">Afghanistan</a> following a <a href=\"/wiki/Internet_outage\" title=\"Internet outage\">internet cut</a> by the <a href=\"/wiki/Government_of_Afghanistan\" title=\"Government of Afghanistan\">government</a>, with <a href=\"/wiki/Mobile_phone\" title=\"Mobile phone\">mobile phone</a> services down to 1% of normal connectivity levels. <a rel=\"nofollow\" class=\"external text\" href=\"https://www.theguardian.com/world/2025/sep/30/afghanistan-mobile-phones-internet-telecoms-blackout-taliban\">(<i>The Guardian</i>)</a></li></ul></li></ul>`

